import React, { useState } from "react";

const Search = () =>{
    const [SearchInput,SetSearchInput] = useState();
    return (
        <>
        <div className="Search_box">
            <input placeholder="Search" type="text" value={SearchInput} />
        </div>
        </>
    )
}

export default Search;
